import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

const Home = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [openSubmenus, setOpenSubmenus] = useState({
    services: false,
    research: false,
    bds: false,
    liyu: false
  });

  const toggleMenu = () => setIsMenuOpen(!isMenuOpen);

  const toggleSubmenu = (menu) => {
    setOpenSubmenus({
      ...openSubmenus,
      [menu]: !openSubmenus[menu]
    });
  };

  // Floating cursor effect
  useEffect(() => {
    const handleMouseMove = (e) => {
      document.documentElement.style.setProperty('--cursor-x', `${e.clientX}px`);
      document.documentElement.style.setProperty('--cursor-y', `${e.clientY}px`);
    };

    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  return (
    <div className="min-h-screen bg-gradient-to-b from-[#f0faff] to-[#e8f9fc] overflow-x-hidden">
      {/* Floating cursor effect */}
      <div className="cursor-dot fixed w-6 h-6 rounded-full bg-gradient-to-r from-primary to-secondary mix-blend-multiply pointer-events-none transform -translate-x-1/2 -translate-y-1/2 z-50"
           style={{ left: 'var(--cursor-x)', top: 'var(--cursor-y)' }}></div>

      {/* Animated floating shapes */}
      <motion.div 
        className="absolute top-1/4 left-1/4 w-72 h-72 bg-primary/5 rounded-full blur-3xl"
        animate={{
          x: [0, 30, 0],
          y: [0, 40, 0],
        }}
        transition={{
          duration: 15,
          repeat: Infinity,
          ease: "easeInOut"
        }}
      />

      <motion.div 
        className="absolute bottom-1/4 right-1/4 w-96 h-96 bg-secondary/5 rounded-full blur-3xl"
        animate={{
          x: [0, -30, 0],
          y: [0, -40, 0],
        }}
        transition={{
          duration: 20,
          repeat: Infinity,
          ease: "easeInOut"
        }}
      />

      {/* Glassmorphic Navigation */}
      <header className="fixed w-full py-4 px-6 z-50 backdrop-blur-md bg-white/70 border-b border-white/10">
        <div className="container mx-auto flex justify-between items-center">
          <div className="flex items-center">
            <motion.div 
              className="text-3xl font-bold text-gray-900"
              initial={{ opacity: 0, y: -20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
            >
              <span className="text-transparent bg-clip-text bg-gradient-to-r from-primary to-secondary">BIRUH</span>MINDS
            </motion.div>
          </div>

          {/* Desktop Navigation */}
          <nav className="hidden md:flex space-x-10">
            {['Home', 'Services', 'About', 'Projects', 'Insights', 'Contact'].map((item, index) => (
              <motion.a
                key={item}
                href="#"
                className="font-medium text-gray-700 hover:text-primary relative group"
                initial={{ opacity: 0, y: -10 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
              >
                {item}
                <span className="absolute bottom-0 left-0 w-0 h-0.5 bg-gradient-to-r from-primary to-secondary group-hover:w-full transition-all duration-300"></span>
              </motion.a>
            ))}
          </nav>

          <div className="hidden md:block">
            <motion.button 
              className="px-6 py-2 bg-gradient-to-r from-primary to-secondary text-white rounded-xl font-medium hover:shadow-lg transition-all duration-300 hover:scale-105"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              Get Started
            </motion.button>
          </div>

          {/* Mobile Menu Toggle */}
          <button 
            className="md:hidden relative w-10 h-10 z-50"
            onClick={toggleMenu}
          >
            <div className={`absolute w-6 h-0.5 bg-gray-800 transition-all duration-300 ${isMenuOpen ? 'rotate-45 translate-y-1.5' : 'translate-y-0'}`}></div>
            <div className={`absolute w-6 h-0.5 bg-gray-800 mt-2 transition-all duration-300 ${isMenuOpen ? 'opacity-0' : 'opacity-100'}`}></div>
            <div className={`absolute w-6 h-0.5 bg-gray-800 mt-4 transition-all duration-300 ${isMenuOpen ? '-rotate-45 -translate-y-1.5' : 'translate-y-0'}`}></div>
          </button>
        </div>

        {/* Mobile Menu */}
        <div className={`fixed inset-0 bg-white z-40 transform transition-all duration-500 ease-in-out ${isMenuOpen ? 'translate-x-0' : 'translate-x-full'}`}>
          <div className="flex flex-col h-full py-20 px-8 overflow-y-auto">
            <div className="space-y-8">
              {['Home', 'Services', 'About', 'Projects', 'Insights', 'Contact'].map((item) => (
                <motion.a
                  key={item}
                  href="#"
                  className="block text-2xl font-bold text-gray-800 py-3 border-b border-gray-100"
                  initial={{ opacity: 0, x: 20 }}
                  animate={{ opacity: 1, x: 0 }}
                  transition={{ duration: 0.3 }}
                >
                  {item}
                </motion.a>
              ))}
            </div>

            <motion.button 
              className="mt-12 px-8 py-4 bg-gradient-to-r from-primary to-secondary text-white rounded-xl font-bold text-lg w-full"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              Contact Us
            </motion.button>
          </div>
        </div>
      </header>

      {/* Hero Section */}
      <section className="relative pt-32 pb-24 overflow-hidden">
        <div className="container mx-auto px-6">
          <div className="flex flex-col lg:flex-row gap-16 items-center">
            <div className="w-full lg:w-1/2 z-10">
              <motion.h1 
                className="text-5xl md:text-6xl font-bold text-gray-900 mb-6 leading-tight"
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.7 }}
              >
                Transform Your Business With{' '}
                <span className="text-transparent bg-clip-text bg-gradient-to-r from-primary to-secondary">
                  Strategic Innovation
                </span>
              </motion.h1>

              <motion.p 
                className="text-xl text-gray-600 mb-10 max-w-lg leading-relaxed"
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.7, delay: 0.1 }}
              >
                Biruhminds Consult delivers cutting-edge solutions that bridge policy and practice, solving complex social and economic challenges with measurable impact.
              </motion.p>

              <motion.div 
                className="flex flex-col sm:flex-row gap-5"
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.7, delay: 0.2 }}
              >
                <motion.button 
                  className="relative overflow-hidden group bg-gradient-to-r from-primary to-secondary text-white px-10 py-4 rounded-xl font-semibold text-lg hover:shadow-xl transition-all duration-300"
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                >
                  <span className="relative z-10">Explore Services</span>
                  <span className="absolute inset-0 bg-gradient-to-r from-secondary to-primary opacity-0 group-hover:opacity-100 transition duration-300"></span>
                </motion.button>

                <motion.button 
                  className="px-10 py-4 rounded-xl font-semibold text-lg border-2 border-primary text-primary hover:bg-primary/5 transition duration-300 flex items-center gap-2"
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                >
                  <span>Contact Us</span>
                  <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                    <path fillRule="evenodd" d="M10.293 5.293a1 1 0 011.414 0l4 4a1 1 0 010 1.414l-4 4a1 1 0 01-1.414-1.414L12.586 11H5a1 1 0 110-2h7.586l-2.293-2.293a1 1 0 010-1.414z" clipRule="evenodd" />
                  </svg>
                </motion.button>
              </motion.div>

              <motion.div 
                className="mt-12 flex items-center gap-6"
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.7, delay: 0.3 }}
              >
                <div className="flex items-center">
                  <svg className="w-5 h-5 text-yellow-400" fill="currentColor" viewBox="0 0 20 20">
                    <path d="M9.049 2.927c.3-.921 1.603-.921 1.902 0l1.07 3.292a1 1 0 00.95.69h3.462c.969 0 1.371 1.24.588 1.81l-2.8 2.034a1 1 0 00-.364 1.118l1.07 3.292c.3.921-.755 1.688-1.54 1.118l-2.8-2.034a1 1 0 00-1.175 0l-2.8 2.034c-.784.57-1.838-.197-1.539-1.118l1.07-3.292a1 1 0 00-.364-1.118L2.98 8.72c-.783-.57-.38-1.81.588-1.81h3.461a1 1 0 00.951-.69l1.07-3.292z"></path>
                  </svg>
                  <p className="ml-1 text-sm font-medium text-gray-900">
                    4.9 <span className="font-normal text-gray-600">(128 reviews)</span>
                  </p>
                </div>
                <p className="text-sm text-gray-500">Trusted by 200+ organizations</p>
              </motion.div>
            </div>

            <motion.div 
              className="w-full lg:w-1/2 z-10"
              initial={{ opacity: 0, scale: 0.8 }}
              animate={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.7, delay: 0.4 }}
            >
              <div className="relative perspective-1000">
                <div className="absolute -bottom-6 -left-6 w-full h-full rounded-2xl border-2 border-primary/20 -z-10 transform rotate-2"></div>
                <div className="grid grid-cols-2 gap-5 relative">
                  <motion.div 
                    className="relative rounded-xl overflow-hidden h-72 bg-gradient-to-br from-primary to-secondary shadow-lg"
                    whileHover={{ y: -10, rotate: -1 }}
                  >
                    <div className="absolute inset-0 flex items-center justify-center p-6">
                      <div className="text-white text-center">
                        <i className="fas fa-lightbulb text-5xl mb-4"></i>
                        <h3 className="font-bold text-xl">Innovative Strategies</h3>
                      </div>
                    </div>
                  </motion.div>

                  <motion.div 
                    className="relative rounded-xl overflow-hidden h-56 bg-gradient-to-br from-secondary to-accent shadow-lg"
                    whileHover={{ y: -10, rotate: 1 }}
                  >
                    <div className="absolute inset-0 flex items-center justify-center p-6">
                      <div className="text-white text-center">
                        <i className="fas fa-chart-line text-5xl mb-4"></i>
                        <h3 className="font-bold text-xl">Growth Analytics</h3>
                      </div>
                    </div>
                  </motion.div>

                  <motion.div 
                    className="relative rounded-xl overflow-hidden h-56 bg-gradient-to-br from-accent to-primary shadow-lg"
                    whileHover={{ y: -10, rotate: -1 }}
                  >
                    <div className="absolute inset-0 flex items-center justify-center p-6">
                      <div className="text-primary text-center">
                        <i className="fas fa-users text-5xl mb-4"></i>
                        <h3 className="font-bold text-xl">Team Building</h3>
                      </div>
                    </div>
                  </motion.div>

                  <motion.div 
                    className="relative rounded-xl overflow-hidden h-72 bg-gradient-to-br from-primary to-accent shadow-lg"
                    whileHover={{ y: -10, rotate: 1 }}
                  >
                    <div className="absolute inset-0 flex items-center justify-center p-6">
                      <div className="text-white text-center">
                        <i className="fas fa-bullseye text-5xl mb-4"></i>
                        <h3 className="font-bold text-xl">Precision Solutions</h3>
                      </div>
                    </div>
                  </motion.div>
                </div>
              </div>
            </motion.div>
          </div>
        </div>
      </section>

      {/* Stats Section */}
      <section className="py-16 bg-white/30 backdrop-blur-sm relative overflow-hidden">
        <div className="absolute inset-0 bg-[url('https://www.transparenttextures.com/patterns/cubes.png')] opacity-10"></div>

        <div className="container mx-auto px-4">
          <div className="grid grid-cols-2 md:grid-cols-4 gap-6">
            {[
              { value: "15+", label: "Years Experience" },
              { value: "250+", label: "Projects Completed" },
              { value: "98%", label: "Client Satisfaction" },
              { value: "50+", label: "Expert Team" }
            ].map((stat, index) => (
              <motion.div
                key={stat.label}
                className="bg-white/80 backdrop-blur-sm border border-white rounded-2xl p-8 text-center shadow-[0_10px_40px_rgba(0,0,0,0.05)] hover:shadow-[0_15px_50px_rgba(138,219,227,0.2)] transition-shadow duration-500"
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
              >
                <div className="text-4xl font-bold text-primary mb-2">{stat.value}</div>
                <div className="text-gray-600">{stat.label}</div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Services Section */}
      <section className="py-24 relative overflow-hidden">
        <div className="absolute top-0 right-0 w-1/3 h-2/3 bg-gradient-to-r from-secondary/5 to-transparent rounded-full blur-3xl"></div>

        <div className="container mx-auto px-6 relative z-10">
          <div className="text-center mb-20">
            <motion.span 
              className="inline-block px-5 py-2 bg-primary/10 text-primary rounded-full font-medium mb-6 text-sm uppercase tracking-wider"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
            >
              Our Expertise
            </motion.span>

            <motion.h2 
              className="text-5xl font-bold text-gray-900 mb-6 leading-tight"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.1 }}
            >
              Transforming{' '}
              <span className="relative inline-block">
                <span className="relative z-10">Ideas</span>
                <span className="absolute bottom-0 left-0 w-full h-3 bg-secondary/30 -rotate-1 z-0"></span>
              </span>{' '}
              Into Impact
            </motion.h2>

            <motion.p 
              className="text-xl text-gray-600 max-w-3xl mx-auto leading-relaxed"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.2 }}
            >
              We bridge innovation and implementation through our multidisciplinary approach to development challenges.
            </motion.p>
          </div>

          <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 max-w-6xl mx-auto">
            {[
              { 
                title: "Business Development", 
                icon: "fas fa-chart-line", 
                description: "Empowering Ethiopia's entrepreneurial ecosystem through tailored growth strategies, investment readiness programs, and market access solutions.",
                color: "primary"
              },
              { 
                title: "Capacity Building", 
                icon: "fas fa-graduation-cap", 
                description: "Transformative training programs that equip professionals and organizations with cutting-edge skills for Ethiopia's evolving development landscape.",
                color: "secondary"
              },
              { 
                title: "Research & Insights", 
                icon: "fas fa-search", 
                description: "Groundbreaking research methodologies that generate actionable intelligence for policy formulation and program design.",
                color: "accent"
              },
              { 
                title: "Financial Inclusion", 
                icon: "fas fa-hand-holding-usd", 
                description: "Innovative financial solutions that empower SMEs and entrepreneurs to access capital and build sustainable businesses.",
                color: "primary"
              }
            ].map((service, index) => (
              <motion.div
                key={service.title}
                className="relative group h-full min-h-[300px] rounded-3xl overflow-hidden shadow-xl hover:shadow-2xl transition-all duration-500 backdrop-blur-sm bg-white/80 border border-white"
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: 0.1 * index }}
                whileHover={{ y: -10 }}
              >
                <div className="absolute inset-0 bg-gradient-to-br from-primary/5 to-primary/20 backdrop-blur-sm opacity-0 group-hover:opacity-100 transition-opacity duration-500"></div>

                <div className="relative z-10 h-full flex flex-col p-8">
                  <div className="mb-6">
                    <div className={`w-16 h-16 rounded-2xl bg-${service.color}/10 flex items-center justify-center text-${service.color} text-3xl mb-6 transition-all duration-300 group-hover:bg-${service.color} group-hover:text-white`}>
                      <i className={service.icon}></i>
                    </div>

                    <h3 className="text-2xl font-bold text-gray-900 mb-4">{service.title}</h3>
                    <div className={`w-12 h-1 bg-${service.color} mb-6`}></div>
                  </div>

                  <p className="text-gray-700 mb-8 flex-grow">
                    {service.description}
                  </p>

                  <div className="mt-auto">
                    <a href="#" className="inline-flex items-center text-primary font-semibold group">
                      <span className="mr-3">Learn more</span>
                      <span className="inline-block group-hover:translate-x-2 transition-transform duration-300">
                        <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                          <path d="M5 12H19M19 12L12 5M19 12L12 19" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                        </svg>
                      </span>
                    </a>
                  </div>
                </div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Testimonials */}
      <section className="py-24 bg-gradient-to-br from-[#f0faff] to-[#e8f9fc] relative overflow-hidden">
        <div className="container mx-auto px-6 relative z-10">
          <div className="max-w-4xl mx-auto text-center mb-16">
            <h2 className="text-4xl font-bold text-gray-900 mb-6">
              What Our <span className="text-primary">Clients Say</span>
            </h2>
            <p className="text-xl text-gray-600">
              Don't just take our word for it - hear from organizations we've helped transform
            </p>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            {[1, 2, 3].map((item, index) => (
              <motion.div
                key={item}
                className="bg-white rounded-2xl p-8 shadow-lg border border-white/50 backdrop-blur-sm"
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
                whileHover={{ y: -10 }}
              >
                <div className="flex items-center mb-6">
                  <div className="w-12 h-12 rounded-full bg-gradient-to-r from-primary to-secondary flex items-center justify-center text-white font-bold">
                    {index + 1}
                  </div>
                  <div className="ml-4">
                    <h4 className="font-bold text-gray-900">Sarah Johnson</h4>
                    <p className="text-gray-500">CEO, Tech Solutions</p>
                  </div>
                </div>

                <div className="flex text-yellow-400 mb-4">
                  {[...Array(5)].map((_, i) => (
                    <svg key={i} className="w-5 h-5" fill="currentColor" viewBox="0 0 20 20">
                      <path d="M9.049 2.927c.3-.921 1.603-.921 1.902 0l1.07 3.292a1 1 0 00.95.69h3.462c.969 0 1.371 1.24.588 1.81l-2.8 2.034a1 1 0 00-.364 1.118l1.07 3.292c.3.921-.755 1.688-1.54 1.118l-2.8-2.034a1 1 0 00-1.175 0l-2.8 2.034c-.784.57-1.838-.197-1.539-1.118l1.07-3.292a1 1 0 00-.364-1.118L2.98 8.72c-.783-.57-.38-1.81.588-1.81h3.461a1 1 0 00.951-.69l1.07-3.292z"></path>
                    </svg>
                  ))}
                </div>

                <p className="text-gray-700 italic">
                  "Biruhminds transformed our approach to market analysis. Their strategic insights helped us increase revenue by 45% in just 6 months. Truly exceptional service!"
                </p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="py-20 relative overflow-hidden">
        <div className="absolute inset-0 bg-gradient-to-r from-primary to-secondary opacity-90"></div>
        <div className="absolute inset-0 bg-[url('https://www.transparenttextures.com/patterns/cubes.png')] opacity-20"></div>

        <div className="container mx-auto px-6 relative z-10">
          <div className="max-w-4xl mx-auto text-center">
            <motion.h2 
